import React from "react";
import Card from './Card';
import contacts from '../contacts';
import Avatar from './Avatar';

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Avatar url='https://www.google.com/url?sa=i&url=http%3A%2F%2Fnickjrcharacters.blogspot.com%2F2014%2F04%2Ftom-and-jerry-clipart.html&psig=AOvVaw3-QnYPEpZhuIBEaq0AJV16&ust=1601853832952000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJirotnImewCFQAAAAAdAAAAABAJ' />
      <Card name={contacts[0].name} url={contacts[0].imgURL} phone={contacts[0].phone} adress={contacts[0].email}/>
      <Card name={contacts[1].name} url={contacts[1].imgURL} phone={contacts[1].phone} adress={contacts[1].email}/>
      <Card name={contacts[2].name} url={contacts[2].imgURL} phone={contacts[2].phone} adress={contacts[2].email}/>
    </div>
  );
}

export default App;
